import React from 'react';
import './App.css';
import Todo from './Todo/Todo';
// Import routing components
import { BrowserRouter, Route, Link } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <div>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/todo">Todo</Link>
          </li>
        </ul>

        <hr />
        <Route path="/todo" component={Todo}/>
      </div>
    </BrowserRouter>
  );
}

export default App;
